import { Button } from 'react-bootstrap';
import { useNavigate } from "react-router-dom"; 

function login() {

    const navigate = useNavigate();

    return(
        <div>
            <h1>Login Page</h1>
            <Button onClick={() => navigate("AddEmp")}>Login</Button>
        </div>
    );
}

export default login;
